import React, {useState} from 'react'
import './App.css';

const Dish = ({ dish }) => {

  return (
    <div>
      <ul>
        <li>
        {dish.name}
        </li>
      </ul>
    </div>
  );

}

const App = () => {
  const [dish, setDish] = useState([
    {name: 'Injera'},
    {name: 'Akara'},
    {name: 'Bandeja Paisa'},
    {name: 'Tandoori Chicken'}
  ])

  return (
    <div className="App">
      {console.log(dish)}
      <div>
        {/*eslint-disable-next-line array-callback-return*/}
        {dish.map((dish) => <Dish  dish={dish} />)}
      </div>
    </div>
  );
}

export default App;
